%[text] ## Handle Converting Energy To Hydrogen
% PEM Electrolyzer System Model for Wind-Hydrogen Integration
% Based on Zhang et al. (2012) - Int. J. Electrochem. Sci.

%% Constants and Parameters
LHV_H2 = 241830;           % J/mol - Lower heating value of H2
F = 96485;                 % C/mol - Faraday constant
R = 8.314;                 % J/(mol*K) - Universal gas constant
molarMass_H2_kg = 0.002016; % kg/mol - Molar mass of H2
LHV_H2_kWh_per_mol = LHV_H2 / 3.6e6; % kWh/mol conversion

% Operating conditions
T_0 = 298.15;              % K - Environment temperature
T = 363;                   % K - Electrolyzer operating temperature  
T_s = 400;                 % K - External heat source temperature
P_H2 = 101325;             % Pa - H2 partial pressure
P_O2 = 101325;             % Pa - O2 partial pressure  
P_H2O = 101325;            % Pa - H2O partial pressure

% Electrolyzer parameters
t_mem = 50e-6;             % m - Membrane thickness
alpha_a = 0.5;             % Anode charge transfer coefficient
alpha_c = 1.0;             % Cathode charge transfer coefficient
j_L = 20000;               % A/m² - Limiting current density
zeta_2 = 2;                % Concentration overvoltage constant
A_p = 0.01;                % m² - Effective polar plate area
a = 1.0;                   % Membrane water activity (fully humidified)
epsilon = 0.7;             % Heat exchanger effectiveness
N_H2O_in = 0.001;          % mol/s - Inlet H2O flow rate

%% Derived Parameters
% Exchange current density (Eq. in paper)
j_0 = 1.08e-17 * exp(0.086 * T);

% Water saturation pressure
P_sat = 1.01325e5 * 10^(2.8206 + 0.02953*(T-273) - 9.1837e-5*(T-273)^2 + 1.4454e-7*(T-273)^3);

% Membrane conductivity (assuming a = 1 for fully humidified conditions)
if a >= 0 && a <= 1
    lambda_mem = 0.043 + 17.81*a - 39.85*a^2 + 36*a^3;
elseif a > 1 && a <= 3
    lambda_mem = 14 + 1.4*(a - 1);
else
    error('Water activity must be between 0 and 3');
end

% Membrane resistivity
sigma_mem = (0.005139*lambda_mem - 0.00326) * exp(1268*(1/303 - 1/T));

% Reversible voltage (Nernst equation)
V_0 = 1.229 - 8.5e-4*(T - T_0) + 4.3085e-5*T*log((P_H2 * sqrt(P_O2))/P_H2O);

%% Main Calculation Function
function [H2_production, H2_storage, efficiency, current_density] = calculateElectrolyzer(surplusPower, params)
    % Extract parameters
    V_0 = params.V_0;
    j_0 = params.j_0;
    alpha_a = params.alpha_a;
    alpha_c = params.alpha_c;
    R = params.R;
    T = params.T;
    F = params.F;
    t_mem = params.t_mem;
    sigma_mem = params.sigma_mem;
    j_L = params.j_L;
    zeta_2 = params.zeta_2;
    A_p = params.A_p;
    LHV_H2 = params.LHV_H2;
    T_0 = params.T_0;
    
    % Initialize output arrays
    n_points = length(surplusPower);
    H2_production = zeros(n_points, 1);    % mol/s
    H2_storage = zeros(n_points, 1);       % kg/h
    efficiency = zeros(n_points, 1);       % dimensionless
    current_density = zeros(n_points, 1);  % A/m²
    
    for i = 1:n_points
        P_surplus = surplusPower(i); % W
        
        % Skip if no surplus power
        if P_surplus <= 0
            continue;
        end
        
        % Initial guess for current density
        j_guess = 1000; % A/m²
        tolerance = 1e-6;
        max_iter = 100;
        
        % Iterative solution for current density
        for iter = 1:max_iter
            % Calculate overpotentials
            V_act = ((alpha_a + alpha_c)/(alpha_a * alpha_c)) * (R*T)/(2*F) * log(j_guess/j_0);
            V_ohm = j_guess * t_mem / sigma_mem;
            V_con = zeta_2 * j_guess / (j_L - j_guess);
            
            % Total cell voltage
            V_cell = V_0 + V_act + V_ohm + V_con;
            
            % Current from power
            I_calc = P_surplus / V_cell;
            j_calc = I_calc / A_p;
            
            % Check convergence
            if abs(j_calc - j_guess) < tolerance
                break;
            end
            
            % Update guess
            j_guess = 0.5 * (j_guess + j_calc);
            
            % Prevent divergence
            if j_guess > 0.9 * j_L
                j_guess = 0.9 * j_L;
            elseif j_guess < 0
                j_guess = 100; % Reset to reasonable value
            end
        end
        
        % Final calculations
        I_final = j_guess * A_p;
        V_final = P_surplus / I_final;
        
        % H2 production rate (Faraday's law)
        N_H2_out = I_final / F; % mol/s
        
        % Calculate Joule heat
        Q_J = I_final * (V_act + V_ohm + V_con);
        
        % Thermal energy demand for water splitting
        Q_thermal = T * N_H2_out * (130.57); % J/s (entropy change ~130.57 J/mol/K for water splitting)
        
        % Net heat from/to electrolyzer
        Q_PEM = Q_J - Q_thermal;
        
        % Calculate efficiency based on configuration
        if Q_PEM >= 0
            % Configuration with heat recovery (Eq. 17 or 18 from paper)
            eta = (N_H2_out * LHV_H2) / P_surplus;
        else
            % Configuration requiring external heat (Eq. 3 from paper)
            Q_H2O_needed = abs(Q_PEM) * (1 - T_0/T); % Exergy of required heat
            eta = (N_H2_out * LHV_H2) / (P_surplus + Q_H2O_needed);
        end
        
        % Ensure efficiency is reasonable
        eta = min(eta, 1.0); % Cap at 100%
        eta = max(eta, 0.0); % Floor at 0%
        
        % Store results
        H2_production(i) = N_H2_out;
        efficiency(i) = eta;
        current_density(i) = j_guess;
        
        % Convert to kg/h for storage
        H2_storage(i) = N_H2_out * params.molarMass_H2_kg * 3600; % kg/h
    end
end

%% Package parameters
params = struct();
params.V_0 = V_0;
params.j_0 = j_0;
params.alpha_a = alpha_a;
params.alpha_c = alpha_c;
params.R = R;
params.T = T;
params.F = F;
params.t_mem = t_mem;
params.sigma_mem = sigma_mem;
params.j_L = j_L;
params.zeta_2 = zeta_2;
params.A_p = A_p;
params.LHV_H2 = LHV_H2;
params.T_0 = T_0;
params.molarMass_H2_kg = molarMass_H2_kg;

