%% Display results function
function displayResults(surplusPower, H2_production, H2_storage, efficiency, current_density)
    fprintf('\n=== PEM Electrolyzer Performance Results ===\n');
    fprintf('Point\tSurplus Power\tCurrent Density\tH2 Production\tH2 Storage\tEfficiency\n');
    fprintf('\t(W)\t\t(A/m²)\t\t(mol/s)\t\t(kg/h)\t\t(%%)\n');
    fprintf('---------------------------------------------------------------------------------\n');
    
    for i = 1:min(10, length(surplusPower)) % Show first 10 points
        if surplusPower(i) > 0
            fprintf('%d\t%.1f\t\t%.1f\t\t%.6f\t%.4f\t\t%.1f\n', ...
                i, surplusPower(i), current_density(i), H2_production(i), ...
                H2_storage(i), efficiency(i)*100);
        end
    end
    
    % Summary statistics
    valid_idx = surplusPower > 0;
    fprintf('\n=== Summary Statistics ===\n');
    fprintf('Average Efficiency: %.1f%%\n', mean(efficiency(valid_idx))*100);
    fprintf('Total H2 Production: %.2f kg\n', sum(H2_storage));
    fprintf('Average Current Density: %.1f A/m²\n', mean(current_density(valid_idx)));
    fprintf('Max Current Density: %.1f A/m²\n', max(current_density));
end

%% Plotting function
function plotResults(surplusPower, efficiency, current_density, H2_storage)
    figure('Position', [100, 100, 1200, 800]);
    
    % Create time vector (assuming hourly data)
    time_hours = 1:length(surplusPower);
    valid_idx = surplusPower > 0;
    
    subplot(2,2,1);
    plot(time_hours, surplusPower/1000, 'b-', 'LineWidth', 1.5);
    xlabel('Time (hours)');
    ylabel('Surplus Power (kW)');
    title('Surplus Power vs Time');
    grid on;
    
    subplot(2,2,2);
    plot(time_hours(valid_idx), efficiency(valid_idx)*100, 'r-', 'LineWidth', 1.5);
    xlabel('Time (hours)');
    ylabel('Efficiency (%)');
    title('Electrolyzer Efficiency vs Time');
    grid on;
    
    subplot(2,2,3);
    plot(time_hours(valid_idx), current_density(valid_idx), 'g-', 'LineWidth', 1.5);
    xlabel('Time (hours)');
    ylabel('Current Density (A/m²)');
    title('Current Density vs Time');
    grid on;
    
    subplot(2,2,4);
    plot(time_hours, H2_storage, 'm-', 'LineWidth', 1.5);
    xlabel('Time (hours)');
    ylabel('H₂ Production (kg/h)');
    title('Hydrogen Production Rate vs Time');
    grid on;
    
    sgtitle('PEM Electrolyzer Performance Analysis');
end

% Efficiency vs Current Density characteristic curve
function plotEfficiencyCharacteristic(params)
    % Generate range of current densities
    j_range = linspace(100, 15000, 1000); % A/m²
    efficiency_char = zeros(size(j_range));
    
    for i = 1:length(j_range)
        j = j_range(i);
        
        % Calculate overpotentials
        V_act = ((params.alpha_a + params.alpha_c)/(params.alpha_a * params.alpha_c)) * ...
                (params.R*params.T)/(2*params.F) * log(j/params.j_0);
        V_ohm = j * params.t_mem / params.sigma_mem;
        V_con = params.zeta_2 * j / (params.j_L - j);
        
        % Total voltage and current
        V_cell = params.V_0 + V_act + V_ohm + V_con;
        I = j * params.A_p;
        
        % H2 production rate
        N_H2 = I / params.F;
        
        % Efficiency (simplified, assuming optimal heat recovery)
        efficiency_char(i) = (N_H2 * params.LHV_H2) / (I * V_cell);
    end
    
    figure;
    plot(j_range, efficiency_char*100, 'b-', 'LineWidth', 2);
    xlabel('Current Density (A/m²)');
    ylabel('Efficiency (%)');
    title('PEM Electrolyzer Efficiency vs Current Density');
    grid on;
    
    % Find and mark maximum efficiency point
    [max_eff, max_idx] = max(efficiency_char);
    hold on;
    plot(j_range(max_idx), max_eff*100, 'ro', 'MarkerSize', 8, 'MarkerFaceColor', 'r');
    text(j_range(max_idx), max_eff*100 + 2, sprintf('Max: %.1f%% at %.0f A/m²', ...
         max_eff*100, j_range(max_idx)), 'HorizontalAlignment', 'center');
end

%% Efficiency Over Time Plotting Functions

function plotEfficiencyOverTime(time_data, efficiency, surplusPower, varargin)
    % Plot electrolyzer efficiency over time with various options
    % 
    % Inputs:
    %   time_data - time vector (hours, days, or datetime array)
    %   efficiency - efficiency array (0-1 scale)
    %   surplusPower - surplus power array (W)
    %   varargin - optional parameters:
    %     'TimeUnit' - 'hours' (default), 'days', 'datetime'
    %     'ShowPower' - true/false to show power overlay
    %     'MovingAverage' - window size for moving average (default: 0, no smoothing)
    %     'Title' - custom title
    
    % Parse optional inputs
    p = inputParser;
    addParameter(p, 'TimeUnit', 'hours', @(x) ismember(x, {'hours', 'days', 'datetime'}));
    addParameter(p, 'ShowPower', true, @islogical);
    addParameter(p, 'MovingAverage', 0, @isnumeric);
    addParameter(p, 'Title', 'PEM Electrolyzer Efficiency Over Time', @ischar);
    addParameter(p, 'FigureSize', [1200, 600], @isnumeric);
    parse(p, varargin{:});
    
    % Create figure
    figure('Position', [100, 100, p.Results.FigureSize]);
    
    % Filter out zero power periods for efficiency plotting
    valid_idx = surplusPower > 0;
    time_valid = time_data(valid_idx);
    eff_valid = efficiency(valid_idx) * 100; % Convert to percentage
    power_valid = surplusPower(valid_idx) / 1000; % Convert to kW
    
    if p.Results.ShowPower
        % Create subplot with two y-axes
        yyaxis left
        if p.Results.MovingAverage > 0
            eff_smooth = movmean(eff_valid, p.Results.MovingAverage, 'omitnan');
            plot(time_valid, eff_smooth, 'b-', 'LineWidth', 2, 'DisplayName', 'Efficiency (smoothed)');
            hold on;
            plot(time_valid, eff_valid, 'b:', 'LineWidth', 0.5, 'DisplayName', 'Efficiency (raw)');
        else
            plot(time_valid, eff_valid, 'b-', 'LineWidth', 1.5, 'DisplayName', 'Efficiency');
        end
        ylabel('Efficiency (%)', 'Color', 'b');
        ylim([0, max(eff_valid)*1.1]);
        
        yyaxis right
        plot(time_data, surplusPower/1000, 'r-', 'LineWidth', 1, 'DisplayName', 'Surplus Power');
        ylabel('Surplus Power (kW)', 'Color', 'r');
        ylim([0, max(surplusPower/1000)*1.1]);
        
    else
        % Single plot for efficiency only
        if p.Results.MovingAverage > 0
            eff_smooth = movmean(eff_valid, p.Results.MovingAverage, 'omitnan');
            plot(time_valid, eff_smooth, 'b-', 'LineWidth', 2, 'DisplayName', 'Efficiency (smoothed)');
            hold on;
            plot(time_valid, eff_valid, 'b:', 'LineWidth', 0.5, 'DisplayName', 'Efficiency (raw)');
            legend('show', 'Location', 'best');
        else
            plot(time_valid, eff_valid, 'b-', 'LineWidth', 1.5);
        end
        ylabel('Efficiency (%)');
        ylim([0, max(eff_valid)*1.1]);
    end
    
    % Set x-axis label based on time unit
    switch p.Results.TimeUnit
        case 'hours'
            xlabel('Time (hours)');
        case 'days'
            xlabel('Time (days)');
        case 'datetime'
            xlabel('Time');
            if isdatetime(time_data)
                xtickangle(45);
            end
    end
    
    title(p.Results.Title);
    grid on;
    
    % Add statistics text box
    avg_eff = mean(eff_valid, 'omitnan');
    std_eff = std(eff_valid, 'omitnan');
    min_eff = min(eff_valid);
    max_eff = max(eff_valid);
    
    stats_text = sprintf(['Efficiency Statistics:\n' ...
                         'Average: %.1f%%\n' ...
                         'Std Dev: %.1f%%\n' ...
                         'Range: %.1f%% - %.1f%%'], ...
                         avg_eff, std_eff, min_eff, max_eff);
    
    text(0.02, 0.98, stats_text, 'Units', 'normalized', 'VerticalAlignment', 'top', ...
         'BackgroundColor', 'white', 'EdgeColor', 'black', 'FontSize', 9);
end

function plotDailyEfficiencyPattern(time_data, efficiency, surplusPower, varargin)
    % Plot average efficiency pattern over 24-hour period
    % Useful for understanding daily wind patterns and electrolyzer performance
    
    % Parse inputs
    p = inputParser;
    addParameter(p, 'GroupByDays', false, @islogical); % Show individual days
    addParameter(p, 'Title', 'Daily Efficiency Pattern', @ischar);
    parse(p, varargin{:});
    
    % Create hour of day from time data
    if isdatetime(time_data)
        hour_of_day = hour(time_data);
    else
        % Assume hourly data starting from hour 0
        hour_of_day = mod(time_data - 1, 24);
    end
    
    % Filter valid data
    valid_idx = surplusPower > 0;
    hour_valid = hour_of_day(valid_idx);
    eff_valid = efficiency(valid_idx) * 100;
    
    figure('Position', [100, 100, 1000, 600]);
    
    if p.Results.GroupByDays && isdatetime(time_data)
        % Show efficiency for each day separately
        day_of_year = day(time_data, 'dayofyear');
        unique_days = unique(day_of_year(valid_idx));
        
        hold on;
        colors = lines(min(length(unique_days), 20)); % Limit colors
        
        for i = 1:min(length(unique_days), 20) % Show max 20 days for clarity
            day_mask = day_of_year == unique_days(i) & valid_idx;
            if sum(day_mask) > 0
                plot(hour_of_day(day_mask), efficiency(day_mask)*100, ...
                     'Color', colors(i,:), 'LineWidth', 1, 'Alpha', 0.3);
            end
        end
        
        % Add average line
        hourly_avg = zeros(24, 1);
        for h = 0:23
            hour_mask = hour_valid == h;
            if sum(hour_mask) > 0
                hourly_avg(h+1) = mean(eff_valid(hour_mask));
            else
                hourly_avg(h+1) = NaN;
            end
        end
        plot(0:23, hourly_avg, 'k-', 'LineWidth', 3, 'DisplayName', 'Average');
        legend('show', 'Location', 'best');
        
    else
        % Show average efficiency by hour
        hourly_avg = zeros(24, 1);
        hourly_std = zeros(24, 1);
        
        for h = 0:23
            hour_mask = hour_valid == h;
            if sum(hour_mask) > 0
                hourly_avg(h+1) = mean(eff_valid(hour_mask));
                hourly_std(h+1) = std(eff_valid(hour_mask));
            else
                hourly_avg(h+1) = NaN;
                hourly_std(h+1) = NaN;
            end
        end
        
        % Plot with error bars
        hours = 0:23;
        errorbar(hours, hourly_avg, hourly_std, 'b-o', 'LineWidth', 1.5, ...
                 'MarkerSize', 4, 'MarkerFaceColor', 'b');
    end
    
    xlabel('Hour of Day');
    ylabel('Efficiency (%)');
    title(p.Results.Title);
    grid on;
    xlim([-0.5, 23.5]);
    xticks(0:3:23);
end

function plotEfficiencyVsPower(efficiency, surplusPower, varargin)
    % Create scatter plot of efficiency vs surplus power
    % Shows the relationship between power level and efficiency
    
    p = inputParser;
    addParameter(p, 'BinSize', 100, @isnumeric); % Power bin size in watts
    addParameter(p, 'ShowTrend', true, @islogical);
    addParameter(p, 'Title', 'Efficiency vs Surplus Power', @ischar);
    parse(p, varargin{:});
    
    % Filter valid data
    valid_idx = surplusPower > 0;
    power_valid = surplusPower(valid_idx) / 1000; % kW
    eff_valid = efficiency(valid_idx) * 100; % %
    
    figure('Position', [100, 100, 800, 600]);
    
    % Create binned data for cleaner visualization
    if p.Results.BinSize > 0
        power_edges = 0:p.Results.BinSize/1000:max(power_valid)+p.Results.BinSize/1000;
        power_centers = power_edges(1:end-1) + diff(power_edges)/2;
        binned_eff = zeros(size(power_centers));
        binned_std = zeros(size(power_centers));
        
        for i = 1:length(power_centers)
            mask = power_valid >= power_edges(i) & power_valid < power_edges(i+1);
            if sum(mask) > 0
                binned_eff(i) = mean(eff_valid(mask));
                binned_std(i) = std(eff_valid(mask));
            else
                binned_eff(i) = NaN;
                binned_std(i) = NaN;
            end
        end
        
        % Remove NaN values
        valid_bins = ~isnan(binned_eff);
        power_centers = power_centers(valid_bins);
        binned_eff = binned_eff(valid_bins);
        binned_std = binned_std(valid_bins);
        
        % Plot binned data with error bars
        errorbar(power_centers, binned_eff, binned_std, 'bo-', 'LineWidth', 1.5, ...
                 'MarkerSize', 6, 'MarkerFaceColor', 'b', 'MarkerEdgeColor', 'b');
        hold on;
        
        if p.Results.ShowTrend && length(power_centers) > 2
            % Fit polynomial trend
            coeffs = polyfit(power_centers, binned_eff, 2);
            power_trend = linspace(min(power_centers), max(power_centers), 100);
            eff_trend = polyval(coeffs, power_trend);
            plot(power_trend, eff_trend, 'r--', 'LineWidth', 2, 'DisplayName', 'Trend');
        end
        
    else
        % Scatter plot of raw data
        scatter(power_valid, eff_valid, 20, 'b', 'filled', 'Alpha', 0.5);
        
        if p.Results.ShowTrend
            coeffs = polyfit(power_valid, eff_valid, 2);
            power_trend = linspace(min(power_valid), max(power_valid), 100);
            eff_trend = polyval(coeffs, power_trend);
            hold on;
            plot(power_trend, eff_trend, 'r-', 'LineWidth', 2, 'DisplayName', 'Trend');
        end
    end
    
    xlabel('Surplus Power (kW)');
    ylabel('Efficiency (%)');
    title(p.Results.Title);
    grid on;
    
    if p.Results.ShowTrend
        legend('show', 'Location', 'best');
    end
end

